nable( 0 ); // enabled by default\n\n        // Set position and look at\n        this.camera.position.x = 1;\n        this.camera.position.y = 1;\n        this.camera.position.z = 100;\n}\n\n    //////////////////////////////// ---- lights -----------------------------////////////////////\n\n    public createLight() {\n      // tslint:disable-next-line:prefer-const\n      let light = new THREE.PointLight(0xffffff, 1, 1000);\n      light.position.set(0, 0, 100);\n      this.scene.add(light);\n\n      light = new THREE.PointLight(0xffffff, 1, 1000);\n      light.position.set(0, 0, -100);\n\n      // add layers to light\n      light.layers.enable( 0 ); // moje\n      light.layers.enable( 1 ); // moje\n      light.layers.enable( 2 ); // moje\n      this.scene.add(light);\n  }\n\n\n}\n\n    \n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/CarusselComponent.html":{"url":"components/CarusselComponent.html","title":"component - CarusselComponent","body":"\n                   \n\n\n\n\n\n  Components\n  CarusselComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/StartApp/welcome/start/simulator/panel-wrapper/mem/active-tool/carussel/carussel.component.ts\n\n\n\n\n    \n        Implements\n    \n    \n                    OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-carussel\n            \n\n            \n                styleUrls\n                ./carussel.component.scss\n            \n\n\n\n            \n                templateUrl\n                ./carussel.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n     